import React from "react"
import {TextField} from "@material-ui/core"


export const CustomField = ({setFieldValue, ...props}) => {

    const handler = (e) => {
        e.target.value = `+998${e.target.value}`;
        setFieldValue(props.name, e);
    };

    return <TextField
        fullWidth
        focused={false}
        variant='outlined'
        onChange={handler}
        {...props}
    />
};
